import React from "react";
import Header from "../components/Header/Header.js";
import axios from 'axios';
import { useState } from 'react';
import { Navigate } from 'react-router-dom';
import { Box, Button, Stack } from "@mui/material";

const ProfilePage = () => {

    const [data, setDataList] = useState([]);
    const [refresh, setRefresh] = useState(false);
    let uloga = 'Korisnik';

    React.useEffect(() => {
        const getData = async () => {
            let dataa = (
                await axios.get('http://localhost:5000/session')
            ).data;
            //setValue(data[0]);
            setDataList(dataa);
            if(data.admin == 1) {
                uloga = 'Admin';
            }
        };
        getData().catch((err) => console.log(err));
    }, [refresh]);

    if (!data) return <Navigate to='/' />;
    return(
        <div>
            <Header />
            <Box
                sx={{
                    display: 'flex',
                    alignItems: 'flex-start',
                    flexDirection: 'column',
                    p: 1,
                    m: 1,
                    bgcolor: 'background.paper',
                    borderRadius: 1,
                    position: 'absolute', left: '20%', top: '15%',
                }}>
                
                <Stack direction='row' justifyContent='center' alignItems='center' spacing='1rem'> 
                    <p> Korisničko ime: {data.username}</p>
                    <Button>Promijeni</Button> 
                </Stack>
                <Stack direction='row' justifyContent='center' alignItems='center' spacing='1rem'> 
                    <p>Ime: {data.name} </p>
                    <Button>Promijeni</Button> 
                </Stack>
                <Stack direction='row' justifyContent='center' alignItems='center' spacing='1rem'> 
                    <p>Prezime: {data.surname} </p>
                    <Button>Promijeni</Button> 
                </Stack>
                <Stack direction='row' justifyContent='center' alignItems='center' spacing='1rem'> 
                    <p>Email adresa: {data.email}</p>
                    <Button>Promijeni</Button> 
                </Stack>
                <Stack direction='row' justifyContent='center' alignItems='center' spacing='1rem'> 
                    <p>Uloga: {uloga}</p>  
                    <Button>Promijeni</Button> 
                </Stack>
                <Stack direction='row' justifyContent='center' alignItems='center' spacing='1rem'> 
                    <p>Grad: </p>
                    <Button>Promijeni</Button> 
                </Stack>
                
            
                
                
            </Box>
        </div>
    );
};

export default ProfilePage;
